import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './login.js';

// Admin pages + layout
import AdminDashboard from './pages/AdminDashboard.js';
import UsersPage from './pages/UsersPage.js';
import UserDashboard from './pages/UserDashboard.js';  // admin ajout hôtel
import Dashboard from './pages/Dashboard.js';

// User (client) pages + layou
import client from './pages/client.js';              // page user client simple

function App() {
  return (
    <Router>
      <Routes>
        {/* page de login accessible à tous */}
        <Route path="/" element={<Login />} />
        <Route path="/login" element={<Login />} />

        {/* Routes Admin protégées sous AdminDashboard layout */}
        <Route path="/admin" element={<AdminDashboard />}>
          <Route index element={<Dashboard />} />           {/* /admin */}
          <Route path="users" element={<UsersPage />} />    {/* /admin/users */}
          <Route path="userdashboard" element={<UserDashboard />} /> {/* /admin/userdashboard */}
        </Route>

        {/* Routes User (client) protégées sous UserClientLayout */}
        <Route path="/user" element={<client.js />}>
                
          {/* Tu peux ajouter d'autres routes user ici */}
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
